import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
    return (
        <div>
            <h1>Panel de Administraci√≥n</h1>
            <div>
                <Link to="/offers" className="btn btn-primary" style={{ backgroundColor: '#F5B041', marginRight: "5px", marginBottom: "5px" }}>
                    Estacionamientos
                </Link>
                <Link to="/userlist" className="btn btn-primary">
                    Usuarios
                </Link>
                <Link to="/reservas" className="btn btn-primary">
                    Reservas
                </Link>
            </div>
        </div>
    );
}

export default Dashboard;
